import React, { Component } from 'react';
import './App.css';
import Home from './components/Home/Home';
import { Route, BrowserRouter } from 'react-router-dom'

class App extends Component {
  render() {
    return (
      <BrowserRouter>
      <div className="App">
        <Route path="/" component={Home} />
      </div>
      </BrowserRouter>
    );
  }
}

export default App;
